Luke Cook, Los Angeles, June 2023. 

He may be hilarious, but that’s only because he’s brilliant and has a deep understanding of his craft. He also recently shared an informative video on the ongoing SAG-AFTRA strike that’s worth checking out.

@thelukecook #portraitphotography #hasselblad #profotoglobal #profotob10 #sagaftra #hasselbladx1d

I see so much work that’s focused purely on the technical aspects of photography, and don’t get me wrong the fancy camera and majestic Rembrandt lighting helps and is wonderful, but portraiture isn’t just about that.

I’ve always seen myself as a messenger, in a way. It’s great to have a point of view, of course, but at the end of the day we are there to serve the telling of someone else’s story, even if it’s from our perspective of that person. The tools are there only to help you in the telling of that story. 

So I’m curious, for you, what makes a successful portrait? 

